import React from "react";

function SkillCard(props){
    const icon = props.icon;
    return(
        // main div 
        <div>
            {/* icon image div  */}
            <div><img src={icon} alt={props.title}></img></div>

            {/* skill name div */}
            <div>{props.title}</div>
        </div>
    );
}

export default SkillCard;
